module Five

open FSharp.Collections.ParallelSeq

let toCharList (s:string) =
    s.ToCharArray() |> List.ofArray

// Must be tail recursive or we will see a stack overflow
let removePairs f l =
    let rec boil acc p = function
        | [] -> match p with
                | Some v -> boil (v::acc) None []
                | None -> List.rev acc    
        | x::xs -> match p with
                    | Some v when f v x -> boil acc None xs
                    | Some v -> boil (v::acc) (Some x) xs
                    | None -> boil acc (Some x) xs
    boil [] None l

let reductionPass c = 
    let willDestroy (c':char) (c'':char) =
        abs (int c' - int c'') = 32
    removePairs willDestroy c

let rec reduce c =    
    let c' = c |> reductionPass
    let len = List.length c
    let len' =  List.length c'
    match len' < len with
    | true -> reduce c'
    | false -> c'

let maxPolymnerRemovalImpact l =
    let removeReduce (r:char) c  = 
        let upper = System.Char.ToUpper r
        let lower = System.Char.ToLower r
        c |> List.filter (fun x -> not (x = upper || x = lower)) |> reduce      
    seq {'a'..'z'} |> PSeq.map (fun x -> (x, l |> removeReduce x |> List.length)) |> PSeq.minBy snd

let execute = fun d ->
    let dataList = d |> toCharList
    let reduced = dataList |> reduce
    printfn "Day 5 - Part 1: Unit count %i" reduced.Length
    let (char, len) = reduced |> maxPolymnerRemovalImpact 
    printfn "Day 5 - Part 2: Greatest impact was %A with final size of %i" char len   

